import "./App.css";
import Navbar from "./Component/navbar";
import FeedBack_user from "./Component/FeedBack_user";
import About from "./Component/about";
import McqPage from "./Component/McqPage";
import LoginPages from "./Component/loginPages";
import ShowFeedback from "./Component/ShowFeedback";
// import GlobleState from "./context/GlobleState";
import { GlobalContextProvider, useGlobalState } from "./context/GlobalContext";

import { BrowserRouter, Routes, Route } from "react-router-dom";
import Plan from "./Component/Plan";

const MyComponent = () => {
  const { state, fetchData } = useGlobalState();

  useEffect(() => {
    fetchData();
  }, []);

  if (state.loading) {
    return <div>Loading...</div>;
  }

  if (state.error) {
    return <div>Error: {state.error}</div>;
  }

  return (
    <div>
      {/* Display your data */}
      {state.data && <pre>{JSON.stringify(state.data, null, 2)}</pre>}
    </div>
  );
};

function App() {
  return (
    //routers concept implimentation
    <GlobalContextProvider>
      <BrowserRouter>
        <Navbar title="Railway MCQ" quiz="MCQ Section" />

        <Routes>
          <Route path="/" element={<About />} />
          <Route path="/FeedBack_user" element={<FeedBack_user />} />
          <Route path="About" element={<About />} />
          <Route path="LoginPages" element={<LoginPages />} />
          <Route path="/Plan" element={<Plan />} />
          <Route path="/McqPage" element={<McqPage />} />
          <Route path="/ShowFeedback" element={<ShowFeedback />} />
        </Routes>
      </BrowserRouter>
    </GlobalContextProvider>
    //props concept implimentation
    // <>
    //   <Navbar title="Railway MCQ" quiz="MCQ Section" />
    //   <div className="container">
    //     <FeedBack_user heading="Dear user please Enter the Feedback!!!!!" />
    //   </div>
    //   <About />
    // </>
  );
}

export default App;
